import { forwardRef } from 'react';
// @mui
import { useTheme } from '@mui/material/styles';
import Link from '@mui/material/Link';
import Box, { BoxProps } from '@mui/material/Box';
// routes
import { RouterLink } from 'src/routes/components';
import { useMode } from '../hooks';

// ----------------------------------------------------------------------

export interface LogoProps extends BoxProps {
  disabledLink?: boolean;
}

export const LogoBig = forwardRef<HTMLDivElement, LogoProps>(
  ({ disabledLink = false, sx, ...other }, ref) => {
    const theme = useTheme();

    const { isDark, isLight } = useMode();
    // OR using local (public folder)
    // -------------------------------------------------------

    const logoDark = (
      <Box>
        <svg
          width="220"
          height="60"
          viewBox="0 0 220 60"
          fill="none"
          xmlns="http://www.w3.org/2000/svg"
          //   xmlns:xlink="http://www.w3.org/1999/xlink"
        >
          <rect width="230" height="55" fill="url(#pattern0_71_829)" />
          <defs>
            <pattern
              id="pattern0_71_829"
              patternContentUnits="objectBoundingBox"
              width="1"
              height="1"
            >
              <use
                xlinkHref="#image0_71_829"
                transform="matrix(0.000336587 0 0 0.00141912 0 0.0096928)"
              />
            </pattern>
            <image
              id="image0_71_829"
              width="2900"
              height="600"
              xlinkHref="data:image/png;base64,"
            />
          </defs>
        </svg>
      </Box>
    );

    const logoWhite = (
      <Box>
        <svg
          width="220"
          height="60"
          viewBox="0 0 220 60"
          fill="none"
          xmlns="http://www.w3.org/2000/svg"
          // xmlns:xlink="http://www.w3.org/1999/xlink"
        >
          <rect width="220" height="65" fill="url(#pattern0)" />
          <defs>
            <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
              <use xlinkHref="#image0_184_1145" transform="scale(0.00131579 0.00454545)" />
            </pattern>
            <image
              id="image0_184_1145"
              width="750"
              height="200"
              xlinkHref="data:image/png;base64,"
            />
          </defs>
        </svg>
      </Box>
    );

    const logo = (
      <Box
        ref={ref}
        component="div"
        sx={{
          width: 200,
          height: 60,
          display: 'inline-flex',
          padding: 1,
          ...sx,
        }}
        {...other}
      >
        {isLight && logoDark}
        {isDark && logoWhite}
      </Box>
    );

    if (disabledLink) {
      return logo;
    }

    return (
      <Link component={RouterLink} href="/" sx={{ display: 'contents' }}>
        {logo}
      </Link>
    );
  }
);
